import React from 'react';
import useDataFetch from './useDataFetch';

const mensaliste = () => {
  const data = useDataFetch('/mensen');
    console.log(data)
  const postTitle = () => {
    if (data) {
        return <h2>{data.title}</h2>;
    }else {
        return <h2>Daten werden geladen...</h2>;
    }
  };

  return (
    <div>
      <h1>Fetch-Hook</h1>
      <div>{postTitle()}</div>
    </div>
  );
}

export default mensaliste;
